namespace Infrastructure.UnitTests.BreedService
{
    public class UpdateBreedTest
    {
        private readonly Mock<IRepository<Breed>> _breedRepositoryMock;
        private readonly Mock<IRepository<ImageBreed>> _imageBreedRepositoryMock;
        private readonly Mock<IRepository<BreedCategory>> _breedCategoryRepositoryMock;
        private readonly Mock<CloudinaryCloudService> _cloudinaryCloudServiceMock;
        private readonly Mock<IHttpContextAccessor> _httpContextAccessorMock;
        private readonly Infrastructure.Services.Implements.BreedService _breedService;
        private readonly Guid _userId = Guid.NewGuid();

        public UpdateBreedTest()
        {
            _breedRepositoryMock = new Mock<IRepository<Breed>>();
            _imageBreedRepositoryMock = new Mock<IRepository<ImageBreed>>();
            _breedCategoryRepositoryMock = new Mock<IRepository<BreedCategory>>();
            _cloudinaryCloudServiceMock = new Mock<CloudinaryCloudService>(Mock.Of<IOptions<CloudinaryConfig>>());
            _httpContextAccessorMock = new Mock<IHttpContextAccessor>();

            var claims = new List<System.Security.Claims.Claim> { new System.Security.Claims.Claim("uid", _userId.ToString()) };
            var identity = new System.Security.Claims.ClaimsIdentity(claims, "TestAuth");
            var principal = new System.Security.Claims.ClaimsPrincipal(identity);
            var httpContext = new DefaultHttpContext { User = principal };
            _httpContextAccessorMock.Setup(x => x.HttpContext).Returns(httpContext);

            _breedService = new Infrastructure.Services.Implements.BreedService(
                _breedRepositoryMock.Object,
                _imageBreedRepositoryMock.Object,
                _cloudinaryCloudServiceMock.Object,
                _breedCategoryRepositoryMock.Object,
                _httpContextAccessorMock.Object
            );
        }

        [Fact]
        public async Task UpdateBreed_RequestNull_ReturnsError()
        {
            var result = await _breedService.UpdateBreed(null, default);
            Assert.False(result.Succeeded);
            Assert.Equal("Dữ liệu giống loài không được null", result.Message);
            Assert.Contains("Dữ liệu giống loài không được null", result.Errors);
        }

        [Fact]
        public async Task UpdateBreed_UserIdEmpty_ReturnsError()
        {
            var httpContextAccessorMock = new Mock<IHttpContextAccessor>();
            httpContextAccessorMock.Setup(x => x.HttpContext).Returns(new DefaultHttpContext());
            var service = new Infrastructure.Services.Implements.BreedService(
                _breedRepositoryMock.Object,
                _imageBreedRepositoryMock.Object,
                _cloudinaryCloudServiceMock.Object,
                _breedCategoryRepositoryMock.Object,
                httpContextAccessorMock.Object
            );
            var request = new UpdateBreedRequest { BreedId = Guid.NewGuid(), BreedName = "Breed1", BreedCategoryId = Guid.NewGuid(), Stock = 10 };
            var result = await service.UpdateBreed(request, default);
            Assert.False(result.Succeeded);
            Assert.Equal("Hãy đăng nhập và thử lại", result.Message);
            Assert.Contains("Hãy đăng nhập và thử lại", result.Errors);
        }

        [Fact]
        public async Task UpdateBreed_BreedNotFound_ReturnsError()
        {
            var request = new UpdateBreedRequest { BreedId = Guid.NewGuid(), BreedName = "Breed1", BreedCategoryId = Guid.NewGuid(), Stock = 10 };
            _breedRepositoryMock.Setup(x => x.GetByIdAsync(request.BreedId, null)).ReturnsAsync((Breed?)null);
            var result = await _breedService.UpdateBreed(request, default);
            Assert.False(result.Succeeded);
            Assert.Equal("Giống loài không tồn tại hoặc đã bị xóa", result.Message);
            Assert.Contains("Giống loài không tồn tại hoặc đã bị xóa", result.Errors);
        }

        [Fact]
        public async Task UpdateBreed_ValidationError_ReturnsError()
        {
            var breedId = Guid.NewGuid();
            var existing = new Breed { Id = breedId, IsActive = true };
            _breedRepositoryMock.Setup(x => x.GetByIdAsync(breedId, null)).ReturnsAsync(existing);
            var request = new UpdateBreedRequest { BreedId = breedId, BreedName = "", BreedCategoryId = Guid.NewGuid(), Stock = 10 };
            var result = await _breedService.UpdateBreed(request, default);
            Assert.False(result.Succeeded);
            Assert.Equal("Dữ liệu không hợp lệ", result.Message);
            Assert.Contains(result.Errors, e => e.Contains("Tên giống loài là bắt buộc"));
        }

        [Fact]
        public async Task UpdateBreed_BreedNameExists_ReturnsError()
        {
            var breedId = Guid.NewGuid();
            var categoryId = Guid.NewGuid();
            var request = new UpdateBreedRequest { BreedId = breedId, BreedName = "Breed1", BreedCategoryId = categoryId, Stock = 10 };
            var existing = new Breed { Id = breedId, IsActive = true };
            _breedRepositoryMock.Setup(x => x.GetByIdAsync(breedId, null)).ReturnsAsync(existing);
            var breeds = new List<Breed> { new Breed { Id = Guid.NewGuid(), BreedName = "Breed1", BreedCategoryId = categoryId, IsActive = true } };
            var mockQueryable = breeds.AsQueryable().BuildMock();
            _breedRepositoryMock.Setup(x => x.GetQueryable(It.IsAny<System.Linq.Expressions.Expression<Func<Breed, bool>>>() ))
                .Returns((System.Linq.Expressions.Expression<Func<Breed, bool>> predicate) => mockQueryable.Where(predicate));
            var result = await _breedService.UpdateBreed(request, default);
            Assert.False(result.Succeeded);
            Assert.Contains("đã tồn tại", result.Message);
            Assert.Contains("đã tồn tại", result.Errors[0]);
        }

        [Fact]
        public async Task UpdateBreed_BreedCategoryNotFound_ReturnsError()
        {
            var breedId = Guid.NewGuid();
            var categoryId = Guid.NewGuid();
            var request = new UpdateBreedRequest { BreedId = breedId, BreedName = "Breed1", BreedCategoryId = categoryId, Stock = 10 };
            var existing = new Breed { Id = breedId, IsActive = true };
            _breedRepositoryMock.Setup(x => x.GetByIdAsync(breedId, null)).ReturnsAsync(existing);
            var breeds = new List<Breed>().AsQueryable().BuildMock();
            _breedRepositoryMock.Setup(x => x.GetQueryable(It.IsAny<System.Linq.Expressions.Expression<Func<Breed, bool>>>() ))
                .Returns((System.Linq.Expressions.Expression<Func<Breed, bool>> predicate) => breeds.Where(predicate));
            _breedCategoryRepositoryMock.Setup(x => x.GetByIdAsync(categoryId, null)).ReturnsAsync((BreedCategory?)null);
            var result = await _breedService.UpdateBreed(request, default);
            Assert.False(result.Succeeded);
            Assert.Equal("Danh mục giống loài không tồn tại hoặc đã bị xóa", result.Message);
            Assert.Contains("Danh mục giống loài không tồn tại hoặc đã bị xóa", result.Errors);
        }

        [Fact]
        public async Task UpdateBreed_Success_WithImageAndThumbnail()
        {
            var breedId = Guid.NewGuid();
            var categoryId = Guid.NewGuid();
            var request = new UpdateBreedRequest
            {
                BreedId = breedId,
                BreedName = "Breed1",
                BreedCategoryId = categoryId,
                Stock = 10,
                Thumbnail = "data:image/png;base64,",
                ImageLinks = new List<string> { "data:image/png;base64,", "data:image/png;base64," }
            };
            var existing = new Breed { Id = breedId, IsActive = true };
            _breedRepositoryMock.Setup(x => x.GetByIdAsync(breedId, null)).ReturnsAsync(existing);
            var breeds = new List<Breed>().AsQueryable().BuildMock();
            _breedRepositoryMock.Setup(x => x.GetQueryable(It.IsAny<System.Linq.Expressions.Expression<Func<Breed, bool>>>() ))
                .Returns((System.Linq.Expressions.Expression<Func<Breed, bool>> predicate) => breeds.Where(predicate));
            _breedCategoryRepositoryMock.Setup(x => x.GetByIdAsync(categoryId, null)).ReturnsAsync(new BreedCategory { Id = categoryId, IsActive = true });
            _breedRepositoryMock.Setup(x => x.Update(It.IsAny<Breed>()));
            _breedRepositoryMock.Setup(x => x.CommitAsync(It.IsAny<CancellationToken>())).ReturnsAsync(1);
            _imageBreedRepositoryMock.Setup(x => x.GetQueryable(It.IsAny<System.Linq.Expressions.Expression<Func<ImageBreed, bool>>>() ))
                .Returns(new List<ImageBreed>().AsQueryable().BuildMock());
            _imageBreedRepositoryMock.Setup(x => x.Remove(It.IsAny<ImageBreed>()));
            _imageBreedRepositoryMock.Setup(x => x.Insert(It.IsAny<ImageBreed>()));
            _imageBreedRepositoryMock.Setup(x => x.CommitAsync(It.IsAny<CancellationToken>())).ReturnsAsync(1);
            _cloudinaryCloudServiceMock.Setup(x => x.DeleteImage(It.IsAny<string>(), It.IsAny<CancellationToken>())).ReturnsAsync("Đã xóa thành công!");
            _cloudinaryCloudServiceMock.Setup(x => x.UploadImage(It.IsAny<string>(), "breed", It.IsAny<CancellationToken>())).ReturnsAsync("https://cloudinary.com/breed-image.jpg");
            var result = await _breedService.UpdateBreed(request, default);
            Assert.True(result.Succeeded);
            Assert.Equal("Cập nhật giống loài thành công", result.Message);
            Assert.Contains("Giống loài đã được cập nhật thành công. ID:", result.Data);
            _breedRepositoryMock.Verify(x => x.Update(It.IsAny<Breed>()), Times.Once());
            _breedRepositoryMock.Verify(x => x.CommitAsync(It.IsAny<CancellationToken>()), Times.Once());
            _imageBreedRepositoryMock.Verify(x => x.Insert(It.IsAny<ImageBreed>()), Times.AtLeastOnce());
            _imageBreedRepositoryMock.Verify(x => x.CommitAsync(It.IsAny<CancellationToken>()), Times.AtLeastOnce());
        }

